import React, { useState } from 'react';
import { motion } from 'framer-motion';

const Projects = () => {
  const [activeFilter, setActiveFilter] = useState('all');
  
  const projects = [
    {
      id: 1,
      title: 'Orrento Rental App',
      category: 'mobile',
      description: 'A comprehensive rental application for various products with secure payment integration and real-time tracking.',
      image: '/images/orrento.jpg',
      technologies: ['Flutter', 'Firebase', 'Stripe'],
      links: {
        live: '#',
        github: '#'
      }
    },
    {
      id: 2,
      title: 'Eventure Event Management',
      category: 'web',
      description: 'Platform for creating, managing, and promoting events with ticket sales and attendee management.',
      image: '/images/eventure.jpg',
      technologies: ['React', 'Node.js', 'MongoDB'],
      links: {
        live: '#',
        github: '#'
      }
    },
    {
      id: 3,
      title: 'Ondule Clothing Brand',
      category: 'web',
      description: 'E-commerce platform for a modern clothing brand with product customization and AR try-on features.',
      image: '/images/ondule.jpg',
      technologies: ['Next.js', 'Shopify', 'Three.js'],
      links: {
        live: '#',
        github: '#'
      }
    },
    {
      id: 4,
      title: 'MogMark Agency',
      category: 'branding',
      description: 'Digital marketing agency website with portfolio showcase, service listings, and client management system.',
      image: '/images/mogmark.jpg',
      technologies: ['HTML/CSS', 'JavaScript', 'PHP'],
      links: {
        live: '#',
        github: '#'
      }
    },
    {
      id: 5,
      title: 'DecorVista',
      category: 'web',
      description: 'Home decor e-commerce platform with interior design consultation and augmented reality preview.',
      image: '/images/decovista.jpg',
      technologies: ['React', 'Node.js', 'AR.js'],
      links: {
        live: '#',
        github: '#'
      }
    },
    {
      id: 6,
      title: 'SadarCables',
      category: 'web',
      description: 'E-commerce store for electronic cables and accessories with inventory management and order tracking.',
      image: '/images/sadarcables.jpg',
      technologies: ['Laravel', 'MySQL', 'Bootstrap'],
      links: {
        live: '#',
        github: '#'
      }
    },
  ];
  
  const filters = [
    { key: 'all', name: 'All Projects' },
    { key: 'web', name: 'Web Apps' },
    { key: 'mobile', name: 'Mobile Apps' },
    { key: 'branding', name: 'Branding' },
  ];
  
  const filteredProjects = activeFilter === 'all' 
    ? projects 
    : projects.filter(project => project.category === activeFilter);
  
  return (
    <section id="projects" className="py-20 relative overflow-hidden">
      <div className="absolute inset-0 grid-bg opacity-10"></div>
      
      <div className="container mx-auto px-4 relative z-10">
        <motion.div 
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl font-bold mb-4 text-white">My Projects</h2>
          <div className="w-20 h-1 bg-gradient-to-r from-neon-blue to-neon-purple mx-auto rounded-full"></div>
        </motion.div>
        
        <motion.div 
          className="flex flex-wrap justify-center gap-4 mb-12"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
          viewport={{ once: true }}
        >
          {filters.map(filter => (
            <button
              key={filter.key}
              onClick={() => setActiveFilter(filter.key)}
              className={`px-6 py-2 rounded-full font-medium transition-all duration-300 ${
                activeFilter === filter.key
                  ? 'bg-gradient-to-r from-neon-blue to-neon-purple text-white shadow-lg shadow-primary-500/30'
                  : 'glass text-slate-300 hover:bg-slate-800/50'
              }`}
            >
              {filter.name}
            </button>
          ))}
        </motion.div>
        
        <motion.div 
          className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8"
          layout
        >
          {filteredProjects.map((project, index) => (
            <motion.div 
              key={project.id}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -10 }}
              className="group rounded-2xl overflow-hidden glass border border-slate-800 hover:border-slate-700 transition-all duration-500"
            >
              <div className="overflow-hidden relative">
                <div className="h-48 bg-gradient-to-br from-primary-900 to-primary-700 flex items-center justify-center">
                  <span className="text-4xl text-white font-bold">{project.title.charAt(0)}</span>
                </div>
                <div className="absolute inset-0 bg-gradient-to-t from-dark-900 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-500 flex items-end p-4">
                  <div className="flex gap-2">
                    {project.links.live && (
                      <a 
                        href={project.links.live} 
                        className="px-4 py-1 text-sm rounded-full bg-white text-dark-900 font-medium hover:bg-slate-200 transition-colors"
                        target="_blank"
                        rel="noopener noreferrer"
                      >
                        Live Demo
                      </a>
                    )}
                    {project.links.github && (
                      <a 
                        href={project.links.github} 
                        className="px-4 py-1 text-sm rounded-full glass border border-slate-700 text-white font-medium hover:bg-slate-800/50 transition-colors"
                        target="_blank"
                        rel="noopener noreferrer"
                      >
                        Code
                      </a>
                    )}
                  </div>
                </div>
              </div>
              
              <div className="p-6">
                <h3 className="text-xl font-bold text-white mb-2">{project.title}</h3>
                <p className="text-slate-400 mb-4">{project.description}</p>
                
                <div className="flex flex-wrap gap-2">
                  {project.technologies.map((tech, i) => (
                    <span 
                      key={i}
                      className="px-3 py-1 text-xs rounded-full bg-slate-800 text-slate-300"
                    >
                      {tech}
                    </span>
                  ))}
                </div>
              </div>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </section>
  );
};

export default Projects;
